import PropTypes from 'prop-types'

function Button(
{children,
    primary,
    secondary,
    success,
    warning,
    danger,
    outline,
    rounded
} ) {
    return <button>{children}</button>
}


Button.propTypes = {
    checkVariationValue: ({    primary,
        secondary,
        success,
        warning,
        danger}) => {
            return new Error('Invalid Props')
    }   
};

export default Button;
